/*
 *----------------------------------------------------------------------------
 *
 * FUNCTION: SE_4p1_ithFieldInType
 *
 *----------------------------------------------------------------------------
 */
SE_DRM_Status_Code
SE_4p1_ithFieldInType
(
          SE_DRM_Type drm_type,
          SE_Short_Integer_Unsigned   i,
    const SE_DRM_Field_Structure    **result_ptr
)
{
    SE_DRM_Status_Code status = SE_DRM_STAT_CODE_SUCCESS;

    if (!SE_ValidNonNullDRMType(drm_type))
    {
        status      = SE_DRM_STAT_CODE_INVALID_TYPE;
        *result_ptr = NULL;
    }
    else if (SE_ConfigInfoTypes[drm_type].type_classification !=
             SE_TYP_CLASSIF_STRUCT)
    {
        status      = SE_DRM_STAT_CODE_INVALID_TYPE_CLASSIFICATION;
        *result_ptr = NULL;
    }
    else if (i >= SE_ConfigInfoTypes[drm_type].field_count)
    {
        status      = SE_DRM_STAT_CODE_INVALID_TYPE_FIELD;
        *result_ptr = NULL;
    }
    else
    {
        *result_ptr = &SE_ConfigInfoTypes[drm_type].u.struct_field[i];
    }
    return status;
} /* end SE_4p1_ithFieldInType */


/*
 *----------------------------------------------------------------------------
 *
 * FUNCTION: SE_4p1_ithEnumerantInType
 *
 *----------------------------------------------------------------------------
 */
SE_DRM_Status_Code
SE_4p1_ithEnumerantInType
(
          SE_DRM_Type    drm_type,
          SE_Short_Integer_Unsigned   i,
    const SE_Enumerant_Structure    **result_out_ptr
)
{
     SE_DRM_Status_Code status = SE_DRM_STAT_CODE_INVALID_TYPE_CLASSIFICATION;

     *result_out_ptr = NULL;

     if (!SE_ValidNonNullDRMType(drm_type))
     {
         status = SE_DRM_STAT_CODE_INVALID_TYPE;
     }
     else if (SE_ConfigInfoTypes[drm_type].type_classification ==
              SE_TYP_CLASSIF_ENUM)
     {
         if (i >= SE_ConfigInfoTypes[drm_type].field_count)
         {
             status = SE_DRM_STAT_CODE_INVALID_ENUMERANT;
         }
         else
         {
             status = SE_DRM_STAT_CODE_SUCCESS;
             *result_out_ptr = &(SE_ConfigInfoTypes[drm_type].
                                u.enum_field[i]);
         }
     }
     else if (SE_ConfigInfoTypes[drm_type].type_classification ==
              SE_TYP_CLASSIF_REGISTERABLE_ENUM)
     {
         if (i >= SE_ConfigInfoTypes[drm_type].field_count)
         {
             status = SE_DRM_STAT_CODE_INVALID_ENUMERANT;
         }
         else
         {
             status = SE_DRM_STAT_CODE_SUCCESS;
             *result_out_ptr = &(SE_ConfigInfoTypes[drm_type].
                               u.registerable_enum_type.
                               enum_field[i]);
         }
     }
     return status;
} /* end SE_4p1_ithEnumerantInType */


